  false,\n\t\"url\": null,\n\t\"notes\": \"This delivery contains point cloud data
  in LAS 1.2 format, classified in the following manner. Class 1: Unclassified and
  Class 2: Ground. Overlap points have been flagged as withheld. The timestamps are
  in absolute GPS time minus 1 billion, in accordance with the LAS 1.2 documentation.
  The following are the collection parameters and equipment used to create this data
  set. Aircraft: Piper Navajo (N6GR) Lidar System: Optech ALTM Gemini (03SEN145) Approximate
  Collection Altitude (Above Mean Terrain): 3800 meters Ground Speed: 160 kts Pulse
  Rate Frequency: 33 kHz Mirror Scan Frequency: 18 Hz Scan Angle (+/-): 16 degrees
  Beam Divergence: Narrow (0.25 mrad) Scan Cutoff: 0.02 degrees Accuracy statements
  are based on areas of moderate terrain, with points classified as ground. Diminished
  accuracies are to be expected in areas of extreme terrain and dense vegetation.
  The accuracy of each point is expected to meet the vertical accuracy standard, derived
  products may be less accurate in areas of extreme terrain and dense vegetation due
  to a lesser number of points defining the ground in these areas. Classified data
  sets such as this one may have varying posting due to some pulses not reaching the
  ground.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
